const datga = Array(3).fill({
    imgSrc: Images.blog1,
    header: 'What Our Customer',
    content: '',
    goTo: '',
    imgAlt: 'blog-img'
})

export default ({}) => (
    <div>
        {
            data.map(i => <BlogCard />)
        }
    </div>
)
